import React from 'react';

export default function Header() {
  return (
    <div>
      <h1 data-testid="page-title">
        {document.title}
      </h1>
      <img
        src="../images/profileIcon.svg"
        alt="Search Icon"
        data-testid="search-top-btn"
      />
      <img
        src="../images/searchIcon.svg"
        alt="Profile button"
        data-testid="profile-top-btn"
      />
    </div>
  );
}
